import './App.scss'

import {
      BrowserRouter as Router,
      Routes,
      Route
    } from "react-router";



import Home from './components/ListEmployeeComponent';


function App() {
  return (
    <>
      <TopBar />
      <div className='content-wrapper'>
        <div className='main-content'>
            <Route exact path='/' component={Home} />

        </div>
      </div>
      <ToastContainer
        position='bottom-right'
        autoClose={2000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
        limit={2}
      />
    </>
  )
}

export default App
